showToken (LBRACKET _) = "["
showToken (LET _) = "let"
showToken (LPAREN _) = "("
showToken (MINUS _) = "-"
showToken (MODULE _) = "module"
showToken (NEWTYPE _) = "newtype"
showToken (OF _) = "of"
showToken (PIPE _) = "|"
